import React from 'react';
import Router from 'next/router';

const CreateBrand = () => {
    return (
        <div>
            <h3>Create My Product</h3>
            <button onClick={() => Router.push('/brands')}>Back</button>
            <select>
                <option value="base">Base Scale</option>
            </select>
        </div>
    )
}

export default CreateBrand;
